import React from 'react'
import WeatherList from '../components/WeatherList'
import WeatherItemContainer from './WeatherItemContainer'
import { connect } from 'react-redux'

const mapStateToProps = state => {
  return {
    cities: state.weather.cities,
  }
}

const WeatherListContainer = ({ cities }) => {
  return <WeatherList cities={cities} item={<WeatherItemContainer />} />
}

export default connect(mapStateToProps)(WeatherListContainer)
